import React from 'react'
import GoogleLoginBtn from 'react-google-login'
import { useState } from 'react'

export const GoogleLogin = () => {

    let [img, setImg] = useState('')
    let [name, setName] = useState('')
    let [auth, setAuth] = useState('')
    const responseGoogle = (response) => {
        console.log(response);
        if (response.status !== 'unknown')
            setAuth(true);
        setName(response.profileObj.name)
        setImg(response.profileObj.imageUrl)
    }

    let googleData;
    auth ? googleData = (
        <div>
            <h1> Hi!{name}</h1>
            <img src={img} alt="" />
        </div>
    ) : googleData = (
        <GoogleLoginBtn
            clientId="566501002041-u2a7osr7ah155liop5pdd485qolqul7d.apps.googleusercontent.com"
            buttonText="Login"
            onSuccess={responseGoogle}
            onFailure={responseGoogle}
            render={renderProps => (
                <button onClick={renderProps.onClick} disabled={renderProps.disabled}></button>
              )}
            cookiePolicy={'single_host_origin'}
        />
    )
    return (
        <div>{googleData}</div>
    )

}
